import time
from multiprocessing import Pool, cpu_count
import os
import traceback
import requests
import json

def thread_task(url):
    try:
        url = "http://127.0.0.1:7832/aa"

        payload = json.dumps({
            "img": ""
        })
        headers = {
            'Content-Type': 'application/json'
        }

        response = requests.request("POST", url, headers=headers, data=payload)
        jsn = json.loads(response.text)
        if jsn["ok"]!=1:
            print(response.text)

    except Exception as e:
        print("Exception: " + str(e))
        traceback.print_exc()
        # raise Exception(str(e))


if __name__ == '__main__':
    num = 2000
    lst_lines = [1]*num

    p = Pool(50)
    print("cpu%d" % cpu_count())
    print("id: %d" % os.getpid())
    print("")
    a = time.time()
    try:
        # 3, cpu_count(), os.getpid()
        result_list = p.map(thread_task, lst_lines)
        print(result_list)

        print("")
        p.close()
        p.terminate()
    except Exception as e:
        print(e)
    finally:
        print("===============close===============")
        p.close()
        p.terminate()
    print((time.time()-a))